import React from 'react';

import DataConsumer from './../dataContext';

class demo extends React.Component{

    componentDidMount(){
    }


    render(){
        return (
            <DataConsumer>
                {
                    (name)=>{
                       return <h1>Hello{name}</h1>
                    }
                }

            </DataConsumer>

        )
    }
}

export default demo;
